using MahApps.Metro.Controls.Dialogs; namespace SimpleApp
{ public class MainWindow : MetroWindow { public MainWindow() { this.InitializeComponent(); // Set the DataContext for your View this.DataContext = new MainWindowViewModel(DialogCoordinator.Instance); } }
