{ public class MainWindowViewModel { // The DialogCoordinator private IDialogCoordinator dialogCoordinator; public MainWindowViewModel(IDialogCoordinator instance) { this.dialogCoordinator = instance; } // Simple method which can be used on a Button public async void FooMessage() { await this.dialogCoordinator.ShowMessageAsync(this, "Message Title", "Bar"); } public async void FooProgress() { // Show... ProgressDialogController controller = await this.dialogCoordinator.ShowProgressAsync(this, "Wait", "Waiting for the Answer to the Ultimate Question of Life, The Universe, and Everything..."); controller.SetIndeterminate(); // Do your work... var result = await Task.Run(...); // Close... await controller.CloseAsync(); } }
